export function testimonialsContentDataSuccess(testimonials) {
    return {
        type: "TESTIMONIALS_CONTENT_DATA_SUCCESS",
        testimonials
    }
}

export const testimonialsContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(testimonials => dispatch(testimonialsContentDataSuccess(testimonials)))
}
